        .shelf_label {
            font: italic 13px sans-serif;
        }
        #cold_storage, #work_room {
            display: none;
        }
    </style>
    <script>
        document.addEventListener("DOMContentLoaded", function () {
            // Cold Storage Room Shelves
            const cold_storage_shelves = ['shelf_11', 'shelf_12', 'shelf_13', 'shelf_14', 'shelf_15', 'shelf_16', 'shelf_17', 'shelf_18', 'shelf_19', 'shelf_20'];
            const work_room_shelves = ['shelf_21', 'shelf_22', 'shelf_23', 'shelf_24', 'shelf_25', 'shelf_26', 'shelf_27', 'shelf_28', 'shelf_29', 'shelf_30', 'shelf_31', 'shelf_32', 'shelf_33', 'shelf_34', 'shelf_35'];

            const coldStorageElement = document.getElementById('cold_storage');
            const workRoomElement = document.getElementById('work_room');
            // Function to get URL parameters
            function getUrlParam(name) {
                const urlParams = new URLSearchParams(window.location.search);
                return urlParams.get(name);
            }

            // Get the shelf
            const shelf = "shelf_" + getUrlParam('shelf');
            const label = "label_" + getUrlParam('shelf');

            if (shelf) {
                const rectElement = document.getElementById(shelf);
                const labelELement = document.getElementById(label);
                rectElement.setAttribute('fill', 'rgba(0,0,0,.4)');
                labelELement.setAttribute('fill', 'rgba(0,0,0,1)');
            }
            if (cold_storage_shelves.includes(shelf)) { coldStorageElement.style.display = 'inline'; }
            if (work_room_shelves.includes(shelf)) { workRoomElement.style.display = 'inline'; }
        });

    </script>
